  const navigate = useNavigate(); // Initialize useNavigate
  const [isDrawerOpen, setDrawerOpen] = useState(false);
  const [anchorEl, setAnchorEl] = useState(null);
  const [selectedVideoId, setSelectedVideoId] = useState(null); // For the video being played
  const [isModalOpen, setModalOpen] = useState(false); // State for the modal

  const handleProfileMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const toggleDrawer = () => {
    setDrawerOpen(!isDrawerOpen);
  };

  // Fetch video from YouTube API
  const fetchVideo = async (videoTitle) => {
    try {
      const response = await axios.get(
        `https://www.googleapis.com/youtube/v3/search`,
        {
          params: {
            key: YOUTUBE_API_KEY,
            q: videoTitle, // The video title clicked on
            type: "video",
            part: "snippet",
            maxResults: 1,
            safeSearch: "strict", // Ensures child-friendly results
          },
        }
      );
      const videoId = response.data.items[0]?.id?.videoId;
      setSelectedVideoId(videoId); // Set the video to be played
      setModalOpen(true); // Open modal when video is ready
    } catch (error) {
      console.error("Error fetching YouTube video:", error);
    }
  };

  // Close modal
  const handleCloseModal = () => {
    setModalOpen(false);
    setSelectedVideoId(null);
  };

